        return new Source("{% extends 'base.html.twig' %}

{% block title %}Login de usuarios{% endblock %}

{% block body %}

    <div class=\"example-wrapper\">
        <h2>Login de usuarios✅</h2>

        {% if error %} <!-- Errores que vienen desde el controlador -->
            <div class=\"alert-error\">
                {{ error.messageKey|trans(error.messageData, 'security') }}
            </div>
        {% endif %}



        <form action=\"{{ path('login') }}\" method=\"POST\"> <!-- A diferencia de laravel, aca se crean manualmente lso formularios -->
            <label for=\"username\">Email</label>
            <input type=\"email\" id=\"username\" name=\"_username\" value=\"{{ last_username }}\">

            <label for=\"password\">Constraseña</label>
            <input type=\"password\" id=\"password\" name=\"_password\">
            <div class=\"clearfix\"></div>
            <input type=\"submit\" value=\"Entrar\">
        </form>

    </div>
{% endblock %}
", "user/login.html.twig", "/opt/lampp/htdocs/web/Master_PHP/proyecto-symfony/templates/user/login.html.twig");
